import java.util.Arrays;

public class SortingAPI {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String[] arr = {"Java", "is", "A", "PIE"};
		Arrays.sort(arr);
		System.out.println("정렬후");
		for (String i : arr) {
			System.out.println(i + "\n");
			
			
		}
	}

}
